import * as types from "../actions/actionTypes";

const INTIAL_STATE = {
    folders: []
};

export const filesDashboard = (state = INTIAL_STATE, action) => {
    console.log(state);
    switch(action.type) {
        case types.GET_FILES:
            return Object.assign({}, state, {
              })
        default:
            return state;
    }
}
